import Applayout from './../components/Applayout';
import Head from "next/head";

const Home = () =>{
    return(
        <>
            <Head>
                <meta charSet='utf-8'></meta>
                <title>NodeBird</title>
            </Head>
            <Applayout>Hello Worldssss</Applayout>
        </>
    );
};

export default Home;
